from typing import List
from collections import deque, defaultdict

class Solution:
    def minJumps(self, arr: List[int]) -> int:
        n = len(arr)
        if n == 1:
            return 0
        
        indices = defaultdict(list)
        for i in range(n):
            indices[arr[i]].append(i)
        
        visited = set()
        visited.add(0)
        steps = 0
        queue = deque([0])
        while queue:
            size = len(queue)
            while size > 0:

                currIndex = queue.popleft()
                size -= 1

                if currIndex == n-1:
                    return steps
                
                nextIndices = indices[arr[currIndex]] + [currIndex + 1, currIndex - 1]
                for i in nextIndices:
                    if 0 <= i < n and i not in visited:
                        visited.add(i)
                        queue.append(i)
                indices[arr[currIndex]].clear()
            steps += 1
        return -1



    
